function Nav() {
  return (
    <ul>
      <li>
        <a>Home</a>
      </li>
      <li>
        <a>About</a>
      </li>
      <li>
        <a>Menu</a>
      </li>
      <li>
        <a>Reservations</a>
      </li>
      <li>
